    snaptoroads_interpolate:
      name: interpolate
      in: query
      description: |
        Whether to interpolate a path to include all points forming the full road-geometry. When true, additional interpolated points will also be returned, resulting in a path that smoothly follows the geometry of the road, even around corners and through tunnels. Interpolated paths will most likely contain more points than the original path. Defaults to `false`.
      schema:
        type: boolean
      example: true
    snaptoroads_path:
      name: path
      description: |
        The path to be snapped. The path parameter accepts a list of latitude/longitude pairs. Latitude and longitude values should be separated by commas. Coordinates should be separated by the pipe character: "|". For example: `path=60.170880,24.942795|60.170879,24.942796|60.170877,24.942796`.
        <div class="note">Note: The snapping algorithm works best for points that are not too far apart. If you observe odd snapping behavior, try creating paths that have points closer together. To ensure the best snap-to-road quality, you should aim to provide paths on which consecutive pairs of points are within 300m of each other. This will also help in handling any isolated, long jumps between consecutive points caused by GPS signal loss, or noise.</div>
      required: true
      in: query
      style: pipeDelimited
      explode: false
      example:
        - '60.170880,24.942795'
        - '60.170879,24.942796'
        - '60.170877,24.942796'
      schema:
        $ref: '#/components/schemas/LatLngArrayString'
    streetview_fov:
      name: fov
      description: |
        Determines the horizontal field of view of the image. The field of view is expressed in degrees, with a maximum allowed value of 120. When dealing with a fixed-size viewport, as with a Street View image of a set size, field of view in essence represents zoom, with smaller numbers indicating a higher level of zoom. Default is 90.
      schema:
        type: number
      in: query
    streetview_heading:
      name: heading
      description: |
        Indicates the compass heading of the camera. Accepted values are from 0 to 360 (both values indicating North, with 90 indicating East, and 180 South). If no heading is specified, a value will be calculated that directs the camera towards the specified location, from the point at which the closest photograph was taken.
      schema:
        type: number
      in: query
    streetview_location:
      name: location
      description: |
        The point around which to retrieve place information. The Street View Static API will snap to the panorama photographed closest to this location. When an address text string is provided, the API may use a different camera location to better display the specified location. When a lat/lng is provided, the API searches a 50 meter radius for a photograph closest to this location. Because Street View imagery is periodically refreshed, and photographs may be taken from slightly different positions each time, it's possible that your `location` may snap to a different panorama when imagery is updated.
      schema:
        type: string
      in: query
      examples:
        latlng:
          value: '40,-110'
        text:
          value: 'Chagrin Falls, OH'
    streetview_pano:
      name: pano
      description: |
        A specific panorama ID. These are generally stable, though panoramas may change ID over time as imagery is refreshed.
      schema:
        type: string
      in: query
    streetview_pitch:
      name: pitch
      description: |
        Specifies the up or down angle of the camera relative to the Street View vehicle. This is often, but not always, flat horizontal. Positive values angle the camera up (with 90 degrees indicating straight up); negative values angle the camera down (with -90 indicating straight down). Default is 0.
      schema:
        type: number
      in: query
    streetview_radius:
      name: radius
      description: |
        Sets a radius, specified in meters, in which to search for a panorama, centered on the given latitude and longitude. Valid values are non-negative integers. Default is 50 meters.
      schema:
        type: number
      in: query
    streetview_return_error_code:
      name: return_error_code
      description: |
        Indicates whether the API should return a non `200 Ok` HTTP status when no image is found (`404 NOT FOUND`), or in response to an invalid request (400 BAD REQUEST). Valid values are `true` and `false`. If set to `true`, an error message is returned in place of the generic gray image. This eliminates the need to make a separate call to check for image availability.
      schema:
        type: boolean
      in: query
    streetview_signature:
      name: signature
      description: |
        A digital signature used to verify that any site generating requests using your API key is authorized to do so. Requests that do not include a digital signature might fail. For more information, see [Get a Key and Signature](https://developers.google.com/maps/documentation/streetview/get-api-key).
      schema:
        type: string
      in: query
    streetview_size_optional:
      name: size
      description: |
        Specifies the output size of the image in pixels. Size is specified as `{width}x{height}` - for example, `size=600x400` returns an image 600 pixels wide, and 400 high.
      schema:
        type: string
      in: query
    streetview_size:
      name: size
      description: |
        Specifies the output size of the image in pixels. Size is specified as `{width}x{height}` - for example, `size=600x400` returns an image 600 pixels wide, and 400 high.
      schema:
        type: string
      in: query
      required: true
    streetview_source:
      name: source
      description: |
        Limits Street View searches to selected sources. Valid values are:
        * `default` uses the default sources for Street View; searches are not limited to specific sources.
        * `outdoor` limits searches to outdoor collections. Indoor collections are not included in search results. Note that outdoor panoramas may not exist for the specified location. Also note that the search only returns panoramas where it's possible to determine whether they're indoors or outdoors. For example, PhotoSpheres are not returned because it's unknown whether they are indoors or outdoors.
      schema:
        type: string
        enum:
          - default
          - outdoor
      in: query
    timezone_location:
      name: location
      description: |
        A comma-separated latitude,longitude tuple, `location=39.6034810,-119.6822510`, representing the location to look up.
      schema:
        type: string
      required: true
      in: query
      example: '39.6034810,-119.6822510'
    timezone_timestamp:
      name: timestamp
      in: query
      description: |
        The desired time as seconds since midnight, January 1, 1970 UTC. The Time Zone API uses the `timestamp` to determine whether or not Daylight Savings should be applied, based on the time zone of the `location`. 

        Note that the API does not take historical time zones into account. That is, if you specify a past timestamp, the API does not take into account the possibility that the location was previously in a different time zone.
      schema:
        type: number
      required: true
      example: 1331161200
    traffic_model:
      name: traffic_model
      description: |
        Specifies the assumptions to use when calculating time in traffic. This setting affects the value returned in the duration_in_traffic field in the response, which contains the predicted time in traffic based on historical averages. The `traffic_model` parameter may only be specified for driving directions where the request includes a `departure_time`. The available values for this parameter are:
        * `best_guess` (default) indicates that the returned duration_in_traffic should be the best estimate of travel time given what is known about both historical traffic conditions and live traffic. Live traffic becomes more important the closer the `departure_time` is to now.
        * `pessimistic` indicates that the returned duration_in_traffic should be longer than the actual travel time on most days, though occasional days with particularly bad traffic conditions may exceed this value.
        * `optimistic` indicates that the returned duration_in_traffic should be shorter than the actual travel time on most days, though occasional days with particularly good traffic conditions may be faster than this value.
        The default value of `best_guess` will give the most useful predictions for the vast majority of use cases. It is possible the `best_guess` travel time prediction may be shorter than `optimistic`, or alternatively, longer than `pessimistic`, due to the way the `best_guess` prediction model integrates live traffic information.
      in: query
      example: pessimistic
      schema:
        type: string
        default: best_guess
        enum:
          - best_guess
          - pessimistic
          - optimistic
    transit_mode:
      name: transit_mode
      description: |
        Specifies one or more preferred modes of transit. This parameter may only be specified for transit directions. The parameter supports the following arguments:
        * `bus` indicates that the calculated route should prefer travel by bus.
        * `subway` indicates that the calculated route should prefer travel by subway.
        * `train` indicates that the calculated route should prefer travel by train.
        * `tram` indicates that the calculated route should prefer travel by tram and light rail.
        * `rail` indicates that the calculated route should prefer travel by train, tram, light rail, and subway. This is equivalent to `transit_mode=train|tram|subway`.
      in: query
      example: train|tram|subway
      schema:
        type: string
    transit_routing_preference:
      name: transit_routing_preference
      description: |
        Specifies preferences for transit routes. Using this parameter, you can bias the options returned, rather than accepting the default best route chosen by the API. This parameter may only be specified for transit directions. The parameter supports the following arguments:
        * `less_walking` indicates that the calculated route should prefer limited amounts of walking.
        * `fewer_transfers` indicates that the calculated route should prefer a limited number of transfers.
      in: query
      example: less_walking
      schema:
        type: string
        enum:
          - less_walking
          - fewer_transfers
  schemas:
    Bounds:
      title: Bounds
      type: object
      description: A rectangle in geographical coordinates from points at the southwest and northeast corners.
      required:
        - northeast
        - southwest
      properties:
        northeast:
          $ref: '#/components/schemas/LatLngLiteral'
        southwest:
          $ref: '#/components/schemas/LatLngLiteral'
    LatLngArrayString:
      description: 'An array of comma separated {latitude,longitude} strings.'
      title: LatLngArrayString
      example:
        - '35,-100'
        - '40,-110'
      type: array
      items:
        type: string
        minItems: 2
    LatLngLiteral:
      type: object
      title: LatLngLiteral
      description: An object describing a specific location with Latitude and Longitude in decimal degrees.
      required:
        - lat
        - lng
      properties:
        lat:
          type: number
          description: Latitude in decimal degrees
        lng:
          type: number
          description: Longitude in decimal degrees
    LatitudeLongitudeLiteral:
      type: object
      title: LatitudeLongitudeLiteral
      description: An object describing a specific location with Latitude and Longitude in decimal degrees.
      required:
        - latitude
        - longitude
      properties:
        latitude:
          type: number
          description: Latitude in decimal degrees
        longitude:
          type: number
          description: Longitude in decimal degrees
    AddressComponent:
      title: AddressComponent
      type: object
      required:
        - long_name
        - short_name
        - types
      properties:
        long_name:
          description: The full text description or name of the address component as returned by the Geocoder.
          type: string
          example: Council of the City of Sydney
        short_name:
          description: 'An abbreviated textual name for the address component, if available. For example, an address component for the state of Alaska may have a long_name of "Alaska" and a short_name of "AK" using the 2-letter postal abbreviation.'
          type: string
          example: Sydney
        types:
          description: 'An array indicating the type of the address component. See the list of [supported types](https://developers.google.com/maps/documentation/places/web-service/supported_types).'
          type: array
          items:
            type: string
          example:
            - administrative_area_level_2
            - political
    Fare:
      type: object
      title: Fare
      description: |
        The total fare for the route.

        ```
        {
          "currency" : "USD",
          "value" : 6,
          "text" : "$6.00"
        }
        ```
      required:
        - currency
        - value
        - text
      properties:
        currency:
          type: string
          description: 'An [ISO 4217 currency code](https://en.wikipedia.org/wiki/ISO_4217) indicating the currency that the amount is expressed in.'
          example: USD
        value:
          type: number
          description: 'The total fare amount, in the currency specified.'
        text:
          type: string
          description: 'The total fare amount, formatted in the requested language.'
          example: $6.00
    Geometry:
      type: object
      title: Geometry
      description: An object describing the location.
      required:
        - location
        - viewport
      properties:
        location:
          $ref: '#/components/schemas/LatLngLiteral'
        viewport:
          $ref: '#/components/schemas/Bounds'
    PlusCode:
      type: object
      title: PlusCode
      description: 'An encoded location reference, derived from latitude and longitude coordinates, that represents an area, 1/8000th of a degree by 1/8000th of a degree (about 14m x 14m at the equator) or smaller. Plus codes can be used as a replacement for street addresses in places where they do not exist (where buildings are not numbered or streets are not named).'
      externalDocs:
        url: 'https://plus.codes/'
        description: Site describing Plus Codes.
      required:
        - global_code
      properties:
        compound_code:
          description: 'The `compound_code` is a 6 character or longer local code with an explicit location (`CWC8+R9, Mountain View, CA, USA`). Some APIs may return an empty string if the `compound_code` is not available.'
          type: string
        global_code:
          description: The `global_code` is a 4 character area code and 6 character or longer local code (`849VCWC8+R9`).
          type: string
    TravelMode:
      type: string
      title: TravelMode
      description: |
        - `DRIVING` (default) indicates calculation using the road network.
        - `BICYCLING` requests calculation for bicycling via bicycle paths & preferred streets (where available).
        - `TRANSIT` requests calculation via public transit routes (where available). 
        - `WALKING` requests calculation for walking via pedestrian paths & sidewalks (where available).
      enum:
        - DRIVING
        - BICYCLING
        - TRANSIT
        - WALKING
    TextValueObject:
      type: object
      title: TextValueObject
      description: An object containing a numeric value and its formatted text representation.
      required:
        - text
        - value
      properties:
        text:
          description: String value.
          type: string
        value:
          description: Numeric value.
          type: number
    TimeZoneTextValueObject:
      type: object
      title: TimeZoneTextValueObject
      description: 'An object containing Unix time, a time zone, and its formatted text representation.'
      required:
        - text
        - time_zone
        - value
      properties:
        text:
          description: The time specified as a string in the time zone.
          type: string
        value:
          description: 'The time specified as Unix time, or seconds since midnight, January 1, 1970 UTC.'
          type: number
        time_zone:
          description: 'Contains the time zone. The value is the name of the time zone as defined in the [IANA Time Zone Database](http://www.iana.org/time-zones), e.g. "America/New_York".'
          type: string
    DistanceMatrixElementStatus:
      type: string
      title: DistanceMatrixElementStatus
      description: |
        - `OK` indicates the response contains a valid result.
        - `NOT_FOUND` indicates that the origin and/or destination of this pairing could not be geocoded.
        - `ZERO_RESULTS` indicates no route could be found between the origin and destination.
        - `MAX_ROUTE_LENGTH_EXCEEDED` indicates the requested route is too long and cannot be processed.
      enum:
        - OK
        - NOT_FOUND
        - ZERO_RESULTS
        - MAX_ROUTE_LENGTH_EXCEEDED
    DistanceMatrixResponse:
      type: object
      title: DistanceMatrixResponse
      required:
        - origin_addresses
        - destination_addresses
        - rows
        - status
      properties:
        origin_addresses:
          description: An array of addresses as returned by the API from your original request. These are formatted by the geocoder and localized according to the language parameter passed with the request. This content is meant to be read as-is. Do not programatically parse the formatted addresses.
          type: array
          items:
            type: string
        destination_addresses:
          description: 'An array of addresses as returned by the API from your original request. As with `origin_addresses`, these are localized if appropriate. This content is meant to be read as-is. Do not programatically parse the formatted addresses.'
          type: array
          items:
            type: string
        rows:
          description: 'An array of elements, which in turn each contain a `status`, `duration`, and `distance` element.'
          type: array
          items:
            $ref: '#/components/schemas/DistanceMatrixRow'
        status:
          description: 'Contains the status of the request, and may contain debugging information to help you track down why the request failed.'
          $ref: '#/components/schemas/DistanceMatrixStatus'
        error_message:
          description: A string containing the human-readable text of any errors encountered while the request was being processed.
          type: string
          example: You have exceeded your rate-limit for this API.
    DistanceMatrixRow:
      type: object
      title: DistanceMatrixRow
      required:
        - elements
      properties:
        elements:
          description: |
            When the Distance Matrix API returns results, it places them within a JSON rows array. Even if no results are returned (such as when the origins and/or destinations don't exist), it still returns an empty array. 

            Rows are ordered according to the values in the origin parameter of the request. Each row corresponds to an origin, and each element within that row corresponds to a pairing of the origin with a destination value.

            Each row array contains one or more element entries, which in turn contain the information about a single origin-destination pairing.
          type: array
          items:
            $ref: '#/components/schemas/DistanceMatrixElement'
    DistanceMatrixElement:
      type: object
      title: DistanceMatrixElement
      required:
        - status
      properties:
        fare:
          description: 'If present, contains the total fare (that is, the total ticket costs) on this route. This property is only returned for transit requests and only for transit providers where fare information is available.'
          $ref: '#/components/schemas/Fare'
        distance:
          description: 'The total distance of this route, expressed in meters (value) and as text. The textual value uses the unit system specified with the unit parameter of the original request, or the origin''s region.'
          $ref: '#/components/schemas/TextValueObject'
        duration_in_traffic:
          description: |
            The length of time it takes to travel this route, based on current and historical traffic conditions. See the `traffic_model` request parameter for the options you can use to request that the returned value is optimistic, pessimistic, or a best-guess estimate. The duration is expressed in seconds (the value field) and as text. The textual representation is localized according to the query's language parameter. The duration in traffic is returned only if all of the following are true:

            * The request includes a `departure_time` parameter.
            * Traffic conditions are available for the requested route.
            * The mode parameter is set to driving.
          $ref: '#/components/schemas/TextValueObject'
        duration:
          description: 'The length of time it takes to travel this route, expressed in seconds (the value field) and as text. The textual representation is localized according to the query''s language parameter.'
          $ref: '#/components/schemas/TextValueObject'
        status:
          description: A status for the element.
          $ref: '#/components/schemas/DistanceMatrixElementStatus'
    DistanceMatrixStatus:
      type: string
      title: DistanceMatrixStatus
      description: |
        Status codes returned by service.
        - `OK` indicates the response contains a valid result.
        - `INVALID_REQUEST` indicates that the provided request was invalid.
        - `MAX_ELEMENTS_EXCEEDED` indicates that the product of origins and destinations exceeds the per-query limit.
        - `MAX_DIMENSIONS_EXCEEDED` indicates that the number of origins or destinations exceeds the per-query limit.
        - `OVER_DAILY_LIMIT` indicates any of the following:
          - The API key is missing or invalid.
          - Billing has not been enabled on your account.
          - A self-imposed usage cap has been exceeded.
          - The provided method of payment is no longer valid (for example, a credit card has expired).
        - `OVER_QUERY_LIMIT` indicates the service has received too many requests from your application within the allowed time period.
        - `REQUEST_DENIED` indicates that the service denied use of the Distance Matrix service by your application.
        - `UNKNOWN_ERROR` indicates a Distance Matrix request could not be processed due to a server error. The request may succeed if you try again.
      enum:
        - OK
        - INVALID_REQUEST
        - MAX_ELEMENTS_EXCEEDED
        - MAX_DIMENSIONS_EXCEEDED
        - OVER_DAILY_LIMIT
        - OVER_QUERY_LIMIT
        - REQUEST_DENIED
        - UNKNOWN_ERROR
    DirectionsResponse:
      type: object
      title: DirectionsResponse
      required:
        - routes
        - status
      properties:
        geocoded_waypoints:
          description: |
            Contains an array with details about the geocoding of origin, destination and waypoints. Elements in the geocoded_waypoints array correspond, by their zero-based position, to the origin, the waypoints in the order they are specified, and the destination.

            These details will not be present for waypoints specified as textual latitude/longitude values if the service returns no results. This is because such waypoints are only reverse geocoded to obtain their representative address after a route has been found. An empty JSON object will occupy the corresponding places in the geocoded_waypoints array.
          type: array
          items:
            $ref: '#/components/schemas/DirectionsGeocodedWaypoint'
        routes:
          description: Contains an array of routes from the origin to the destination. Routes consist of nested Legs and Steps.
          type: array
          items:
            $ref: '#/components/schemas/DirectionsRoute'
        status:
          description: 'Contains the status of the request, and may contain debugging information to help you track down why the request failed.'
          $ref: '#/components/schemas/DirectionsStatus'
        available_travel_modes:
          description: Contains an array of available travel modes. This field is returned when a request specifies a travel mode and gets no results. The array contains the available travel modes in the countries of the given set of waypoints. This field is not returned if one or more of the waypoints are 'via waypoints'.
          type: array
          items:
            $ref: '#/components/schemas/TravelMode'
        error_message:
          description: |
            When the service returns a status code other than `OK`, there may be an additional `error_message` field within the response object. This field contains more detailed information about the reasons behind the given status code. This field is not always returned, and its content is subject to change.
          type: string
    DirectionsStep:
      type: object
      title: DirectionsStep
      description: |
        Each element in the steps array defines a single step of the calculated directions. A step is the most atomic unit of a direction's route, containing a single step describing a specific, single instruction on the journey. E.g. "Turn left at W. 4th St." The step not only describes the instruction but also contains distance and duration information relating to how this step relates to the following step. For example, a step denoted as "Merge onto I-80 West" may contain a duration of "37 miles" and "40 minutes," indicating that the next step is 37 miles/40 minutes from this step.

        When using the Directions API to search for transit directions, the steps array will include additional transit details in the form of a transit_details array. If the directions include multiple modes of transportation, detailed directions will be provided for walking or driving steps in an inner steps array. For example, a walking step will include directions from the start and end locations: "Walk to Innes Ave & Fitch St". That step will include detailed walking directions for that route in the inner steps array, such as: "Head north-west", "Turn left onto Arelious Walker", and "Turn left onto Innes Ave".
      required:
        - duration
        - end_location
        - start_location
        - html_instructions
        - polyline
        - travel_mode
      properties:
        distance:
          description: Contains the distance covered by this step until the next step. This field may be undefined if the distance is unknown.
          $ref: '#/components/schemas/TextValueObject'
        duration:
          description: 'Contains the typical time required to perform the step, until the next step. This field may be undefined if the duration is unknown.'
          $ref: '#/components/schemas/TextValueObject'
        end_location:
          description: Contains the location of the last point of this step.
          $ref: '#/components/schemas/LatLngLiteral'
        html_instructions:
          type: string
          description: 'Contains formatted instructions for this step, presented as an HTML text string. This content is meant to be read as-is. Do not programmatically parse this display-only content.'
        maneuver:
          type: string
          description: 'Contains the action to take for the current step (turn left, merge, straight, etc.). Values are subject to change, and new values may be introduced without prior notice.'
          enum:
            - turn-slight-left
            - turn-sharp-left
            - turn-left
            - turn-slight-right
            - turn-sharp-right
            - keep-right
            - keep-left
            - uturn-left
            - uturn-right
            - turn-right
            - straight
            - ramp-left
            - ramp-right
            - merge
            - fork-left
            - fork-right
            - ferry
            - ferry-train
            - roundabout-left
            - roundabout-right
        polyline:
          $ref: '#/components/schemas/DirectionsPolyline'
          description: 'Contains a single points object that holds an [encoded polyline](https://developers..google.com/maps/documentation/utilities/polylinealgorithm) representation of the step. This polyline is an approximate (smoothed) path of the step.'
        start_location:
          description: Contains the location of the starting point of this step.
          $ref: '#/components/schemas/LatLngLiteral'
        transit_details:
          description: Details pertaining to this step if the travel mode is `TRANSIT`.
          $ref: '#/components/schemas/DirectionsTransitDetails'
        travel_mode:
          description: Contains the type of travel mode used.
          $ref: '#/components/schemas/TravelMode'
        steps:
          description: Contains detailed directions for walking or driving steps in transit directions. Substeps are only available when travel_mode is set to "transit". The inner steps array is of the same type as steps.
    DirectionsLeg:
      type: object
      title: DirectionsLeg
      required:
        - end_address
        - end_location
        - start_address
        - start_location
        - steps
        - traffic_speed_entry
        - via_waypoint
      properties:
        arrival_time:
          description: Contains the estimated time of arrival for this leg. This property is only returned for transit directions.
          $ref: '#/components/schemas/TimeZoneTextValueObject'
        departure_time:
          description: 'Contains the estimated time of departure for this leg, specified as a Time object. The `departure_time` is only available for transit directions.'
          $ref: '#/components/schemas/TimeZoneTextValueObject'
        distance:
          description: The total distance covered by this leg.
          $ref: '#/components/schemas/TextValueObject'
        duration:
          description: The total duration of this leg.
          $ref: '#/components/schemas/TextValueObject'
        duration_in_traffic:
          description: |
            Indicates the total duration of this leg. This value is an estimate of the time in traffic based on current and historical traffic conditions. See the `traffic_model` request parameter for the options you can use to request that the returned value is optimistic, pessimistic, or a best-guess estimate. The duration in traffic is returned only if all of the following are true:

            * The request does not include stopover waypoints. If the request includes waypoints, they must be prefixed with `via:` to avoid stopovers.
            * The request is specifically for driving directionsâthe mode parameter is set to `driving`.
            * The request includes a `departure_time` parameter.
            * Traffic conditions are available for the requested route.
          $ref: '#/components/schemas/TextValueObject'
        end_address:
          description: Contains the human-readable address (typically a street address) from reverse geocoding the `end_location` of this leg. This content is meant to be read as-is. Do not programmatically parse the formatted address.
          type: string
        end_location:
          description: 'The latitude/longitude coordinates of the given destination of this leg. Because the Directions API calculates directions between locations by using the nearest transportation option (usually a road) at the start and end points, `end_location` may be different than the provided destination of this leg if, for example, a road is not near the destination.'
          $ref: '#/components/schemas/LatLngLiteral'
        start_address:
          description: Contains the human-readable address (typically a street address) resulting from reverse geocoding the `start_location` of this leg. This content is meant to be read as-is. Do not programmatically parse the formatted address.
          type: string
        start_location:
          description: 'The latitude/longitude coordinates of the origin of this leg. Because the Directions API calculates directions between locations by using the nearest transportation option (usually a road) at the start and end points, `start_location` may be different than the provided origin of this leg if, for example, a road is not near the origin.'
          $ref: '#/components/schemas/LatLngLiteral'
        steps:
          description: An array of steps denoting information about each separate step of the leg of the journey.
          type: array
          items:
            $ref: '#/components/schemas/DirectionsStep'
        traffic_speed_entry:
          deprecated: true
          description: Information about traffic speed along the leg.
          type: array
          items:
            $ref: '#/components/schemas/DirectionsTrafficSpeedEntry'
        via_waypoint:
          description: The locations of via waypoints along this leg.
          type: array
          items:
            $ref: '#/components/schemas/DirectionsViaWaypoint'
    DirectionsRoute:
      type: object
      title: DirectionsRoute
      description: Routes consist of nested `legs` and `steps`.
      required:
        - bounds
        - copyrights
        - legs
        - overview_polyline
        - summary
        - warnings
        - waypoint_order
      properties:
        legs:
          description: 'An array which contains information about a leg of the route, between two locations within the given route. A separate leg will be present for each waypoint or destination specified. (A route with no waypoints will contain exactly one leg within the legs array.) Each leg consists of a series of steps.'
          type: array
          items:
            $ref: '#/components/schemas/DirectionsLeg'
        bounds:
          description: Contains the viewport bounding box of the `overview_polyline`.
          $ref: '#/components/schemas/Bounds'
        copyrights:
          type: string
          description: Contains an array of warnings to be displayed when showing these directions. You must handle and display these warnings yourself.
        summary:
          type: string
          description: 'Contains a short textual description for the route, suitable for naming and disambiguating the route from alternatives.'
        waypoint_order:
          type: array
          description: 'An array indicating the order of any waypoints in the calculated route. This waypoints may be reordered if the request was passed optimize:true within its waypoints parameter.'
          items:
            type: integer
        warnings:
          type: array
          description: Contains an array of warnings to be displayed when showing these directions. You must handle and display these warnings yourself.
          items:
            type: string
        overview_polyline:
          description: Contains an object that holds an encoded polyline representation of the route. This polyline is an approximate (smoothed) path of the resulting directions.
          $ref: '#/components/schemas/DirectionsPolyline'
        fare:
          description: 'If present, contains the total fare (that is, the total ticket costs) on this route. This property is only returned for transit requests and only for routes where fare information is available for all transit legs.'
          $ref: '#/components/schemas/Fare'
    DirectionsStatus:
      type: string
      title: DirectionsStatus
      description: |
        The status field within the Directions response object contains the status of the request, and may contain debugging information to help you track down why the Directions service failed. The status field may contain the following values:

        - `OK` indicates the response contains a valid result.
        - `NOT_FOUND` indicates at least one of the locations specified in the request's origin, destination, or waypoints could not be geocoded.
        - `ZERO_RESULTS` indicates no route could be found between the origin and destination.
        - `MAX_WAYPOINTS_EXCEEDED` indicates that too many waypoints were provided in the request. For applications using the Directions API as a web service, or the directions service in the Maps JavaScript API, the maximum allowed number of waypoints is 25, plus the origin and destination.
        - `MAX_ROUTE_LENGTH_EXCEEDED` indicates the requested route is too long and cannot be processed. This error occurs when more complex directions are returned. Try reducing the number of waypoints, turns, or instructions.
        - `INVALID_REQUEST` indicates that the provided request was invalid. Common causes of this status include an invalid parameter or parameter value.
        - `OVER_DAILY_LIMIT` indicates any of the following:
            - The API key is missing or invalid.
            - Billing has not been enabled on your account.
            - A self-imposed usage cap has been exceeded.
            - The provided method of payment is no longer valid (for example, a credit card has expired).
            See the [Maps FAQ](https://developers.google.com/maps/faq#over-limit-key-error) to learn how to fix this.
        - `OVER_QUERY_LIMIT` indicates the service has received too many requests from your application within the allowed time period.
        - `REQUEST_DENIED` indicates that the service denied use of the directions service by your application.
        - `UNKNOWN_ERROR` indicates a directions request could not be processed due to a server error. The request may succeed if you try again.
      enum:
        - OK
        - NOT_FOUND
        - ZERO_RESULTS
        - MAX_WAYPOINTS_EXCEEDED
        - MAX_ROUTE_LENGTH_EXCEEDED
        - INVALID_REQUEST
        - OVER_DAILY_LIMIT
        - OVER_QUERY_LIMIT
        - REQUEST_DENIED
        - UNKNOWN_ERROR
    DirectionsGeocodedWaypoint:
      type: object
      title: DirectionsGeocodedWaypoint
      properties:
        geocoder_status:
          description: Indicates the status code resulting from the geocoding operation. This field may contain the following values.
          type: string
          enum:
            - OK
            - ZERO_RESULTS
        partial_match:
          description: |
            Indicates that the geocoder did not return an exact match for the original request, though it was able to match part of the requested address. You may wish to examine the original request for misspellings and/or an incomplete address.

            Partial matches most often occur for street addresses that do not exist within the locality you pass in the request. Partial matches may also be returned when a request matches two or more locations in the same locality. For example, "21 Henr St, Bristol, UK" will return a partial match for both Henry Street and Henrietta Street. Note that if a request includes a misspelled address component, the geocoding service may suggest an alternative address. Suggestions triggered in this way will also be marked as a partial match.
        place_id:
          description: 'A unique identifier that can be used with other Google APIs. See the [Place ID overview](https://developers.google.com/maps/documentation/places/web-service/place-id).'
          type: string
        types:
          description: |
            Indicates the address type of the geocoding result used for calculating directions.

            * `administrative_area_level_1` indicates a first-order civil entity below the country level. Within the United States, these administrative levels are states. Not all nations exhibit these administrative levels. In most cases, administrative_area_level_1 short names will closely match ISO 3166-2 subdivisions and other widely circulated lists; however this is not guaranteed as our geocoding results are based on a variety of signals and location data.
            * `administrative_area_level_2` indicates a second-order civil entity below the country level. Within the United States, these administrative levels are counties. Not all nations exhibit these administrative levels.
            * `administrative_area_level_3` indicates a third-order civil entity below the country level. This type indicates a minor civil division. Not all nations exhibit these administrative levels.
            * `administrative_area_level_4` indicates a fourth-order civil entity below the country level. This type indicates a minor civil division. Not all nations exhibit these administrative levels.
            * `administrative_area_level_5` indicates a fifth-order civil entity below the country level. This type indicates a minor civil division. Not all nations exhibit these administrative levels.
            * `airport` indicates an airport.
            * `colloquial_area` indicates a commonly-used alternative name for the entity.
            * `country` indicates the national political entity, and is typically the highest order type returned by the Geocoder.
            * `intersection` indicates a major intersection, usually of two major roads.
            * `locality` indicates an incorporated city or town political entity.
            * `natural_feature` indicates a prominent natural feature.
            * `neighborhood` indicates a named neighborhood
            * `park` indicates a named park.
            * `plus_code` indicates an encoded location reference, derived from latitude and longitude. Plus codes can be used as a replacement for street addresses in places where they do not exist (where buildings are not numbered or streets are not named). See [https://plus.codes](https://plus.codes/) for details.
            * `point_of_interest` indicates a named point of interest. Typically, these "POI"s are prominent local entities that don't easily fit in another category, such as "Empire State Building" or "Eiffel Tower".
            * `political` indicates a political entity. Usually, this type indicates a polygon of some civil administration.
            * `postal_code` indicates a postal code as used to address postal mail within the country.
            * `premise` indicates a named location, usually a building or collection of buildings with a common name
            * `route` indicates a named route (such as "US 101").
            * `street_address` indicates a precise street address.
            * `sublocality` indicates a first-order civil entity below a locality. For some locations may receive one of the additional types: sublocality_level_1 to sublocality_level_5. Each sublocality level is a civil entity. Larger numbers indicate a smaller geographic area.
            * `subpremise` indicates a first-order entity below a named location, usually a singular building within a collection of buildings with a common name
            * `tourist_attraction` indicates a tourist attraction.
            * `train_station` indicates a train station.
            * `transit_station` indicates a transit station.

            An empty list of types indicates there are no known types for the particular address component, for example, Lieu-dit in France.
          type: array
          items:
            type: string
            enum:
              - administrative_area_level_1
              - administrative_area_level_2
              - administrative_area_level_3
              - administrative_area_level_4
              - administrative_area_level_5
              - amusement_park
              - airport
              - colloquial_area
              - country
              - establishment
              - intersection
              - locality
              - natural_feature
              - neighborhood
              - park
              - plus_code
              - point_of_interest
              - political
              - postal_code
              - premise
              - route
              - street_address
              - sublocality
              - sublocality_level_1
              - subpremise
              - tourist_attraction
              - train_station
              - transit_station
    DirectionsPolyline:
      type: object
      title: DirectionsPolyline
      description: |
        [Polyline encoding](https://developers.google.com/maps/documentation/utilities/polylinealgorithm) is a lossy compression algorithm that allows you to store a series of coordinates as a single string. Point coordinates are encoded using signed values. If you only have a few static points, you may also wish to use the interactive polyline encoding utility.

        The encoding process converts a binary value into a series of character codes for ASCII characters using the familiar base64 encoding scheme: to ensure proper display of these characters, encoded values are summed with 63 (the ASCII character '?') before converting them into ASCII. The algorithm also checks for additional character codes for a given point by checking the least significant bit of each byte group; if this bit is set to 1, the point is not yet fully formed and additional data must follow.

        Additionally, to conserve space, points only include the offset from the previous point (except of course for the first point). All points are encoded in Base64 as signed integers, as latitudes and longitudes are signed values. The encoding format within a polyline needs to represent two coordinates representing latitude and longitude to a reasonable precision. Given a maximum longitude of +/- 180 degrees to a precision of 5 decimal places (180.00000 to -180.00000), this results in the need for a 32 bit signed binary integer value.
      required:
        - points
      properties:
        points:
          type: string
          description: A single string representation of the polyline.
          example: chnwEbderQ?XR@D?@?
