          type: number
    ElevationResult:
      type: object
      title: ElevationResult
      required:
        - elevation
        - location
      properties:
        elevation:
          description: The elevation of the location in meters.
          type: number
        resolution:
          description: 'The value indicating the maximum distance between data points from which the elevation was interpolated, in meters. This property will be missing if the resolution is not known. Note that elevation data becomes more coarse (larger resolution values) when multiple points are passed. To obtain the most accurate elevation value for a point, it should be queried independently.'
          type: number
        location:
          description: 'A location element of the position for which elevation data is being computed. Note that for path requests, the set of location elements will contain the sampled points along the path.'
          $ref: '#/components/schemas/LatLngLiteral'
    ElevationResponse:
      type: object
      title: ElevationResponse
      required:
        - status
        - results
      properties:
        error_message:
          description: |
            When the service returns a status code other than `OK`, there may be an additional `error_message` field within the response object. This field contains more detailed information about thereasons behind the given status code. This field is not always returned, and its content is subject to change.
          type: string
          example: Invalid request. Invalid 'locations' parameter.
        status:
          $ref: '#/components/schemas/ElevationStatus'
        results:
          type: array
          items:
            $ref: '#/components/schemas/ElevationResult'
    ElevationStatus:
      type: string
      title: ElevationStatus
      description: |
        Status codes returned by service.
        - `OK` indicating the API request was successful.
        - `DATA_NOT_AVAILABLE` indicating that there's no available data for the input locations. 
        - `INVALID_REQUEST` indicating the API request was malformed.
        - `OVER_DAILY_LIMIT` indicating any of the following:
          - The API key is missing or invalid.
          - Billing has not been enabled on your account.
          - A self-imposed usage cap has been exceeded.
          - The provided method of payment is no longer valid (for example, a credit card has expired).
        - `OVER_QUERY_LIMIT` indicating the requestor has exceeded quota.
        - `REQUEST_DENIED` indicating the API did not complete the request.
        - `UNKNOWN_ERROR` indicating an unknown error.
      enum:
        - OK
        - DATA_NOT_AVAILABLE
        - INVALID_REQUEST
        - OVER_DAILY_LIMIT
        - OVER_QUERY_LIMIT
        - REQUEST_DENIED
        - UNKNOWN_ERROR
    GeocodingResult:
      type: object
      title: GeocodingResult
      required:
        - address_components
        - formatted_address
        - geometry
        - place_id
        - types
      properties:
        address_components:
          description: An array containing the separate components applicable to this address.
          type: array
          items:
            $ref: '#/components/schemas/AddressComponent'
        formatted_address:
          description: The human-readable address of this location.
          type: string
        geometry:
          $ref: '#/components/schemas/GeocodingGeometry'
        place_id:
          description: 'A unique identifier that can be used with other Google APIs. For example, you can use the `place_id` in a Places API request to get details of a local business, such as phone number, opening hours, user reviews, and more. See the [place ID overview](https://developers.google.com/places/place-id).'
          type: string
        plus_code:
          $ref: '#/components/schemas/PlusCode'
        types:
          description: 'The `types[]` array indicates the type of the returned result. This array contains a set of zero or more tags identifying the type of feature returned in the result. For example, a geocode of "Chicago" returns "locality" which indicates that "Chicago" is a city, and also returns "political" which indicates it is a political entity.'
          type: array
          items:
            type: string
        postcode_localities:
          description: An array denoting all the localities contained in a postal code. This is only present when the result is a postal code that contains multiple localities.
          type: array
          items:
            type: string
        partial_match:
          description: |
            Indicates that the geocoder did not return an exact match for the original request, though it was able to match part of the requested address. You may wish to examine the original request for misspellings and/or an incomplete address.

            Partial matches most often occur for street addresses that do not exist within the locality you pass in the request. Partial matches may also be returned when a request matches two or more locations in the same locality.
          type: boolean
    GeocodingResponse:
      type: object
      title: GeocodingResponse
      required:
        - status
        - results
      properties:
        plus_code:
          description: |
            An encoded location reference, derived from latitude and longitude coordinates, that represents an area: 1/8000th of a degree by 1/8000th of a degree (about 14m x 14m at the equator) or smaller. Plus codes can be used as a replacement for street addresses in places where they do not exist (where buildings are not numbered or streets are not named). See [Open Location Code](https://en.wikipedia.org/wiki/Open_Location_Code) and [plus codes](https://plus.codes/).
          $ref: '#/components/schemas/PlusCode'
        results:
          type: array
          items:
            $ref: '#/components/schemas/GeocodingResult'
        status:
          $ref: '#/components/schemas/GeocodingStatus'
        error_message:
          description: A short description of the error.
          type: string
          example: 'Invalid request. Missing the `address`, `components`, `latlng` or `place_id` parameter.'
    GeocodingStatus:
      type: string
      title: GeocodingStatus
      description: |
        The `status` field within the Geocoding response object contains the status of the request, and may contain debugging information to help you track down why geocoding is not working. The "status" field may contain the following values:

        - `OK` indicates that no errors occurred; the address was successfully parsed and at least one geocode was returned.
        - `ZERO_RESULTS` indicates that the geocode was successful but returned no results. This may occur if the geocoder was passed a non-existent address or a `latlng` in a remote location.
        - `OVER_DAILY_LIMIT` indicates any of the following:
          - The API key is missing or invalid.
          - Billing has not been enabled on your account.
          - A self-imposed usage cap has been exceeded.
          - The provided method of payment is no longer valid (for example, a credit card has expired).
        - `OVER_QUERY_LIMIT` indicates that you are over your quota.
        - `REQUEST_DENIED` indicates that your request was denied.
        - `INVALID_REQUEST` generally indicates that the query (address, components, or latlng) is missing.
        - `UNKNOWN_ERROR` indicates that the request could not be processed due to a server error. The request may succeed if you try again.
      enum:
        - OK
        - INVALID_REQUEST
        - OVER_DAILY_LIMIT
        - OVER_QUERY_LIMIT
        - REQUEST_DENIED
        - UNKNOWN_ERROR
        - ZERO_RESULTS
    GeocodingGeometry:
      type: object
      title: GeocodingGeometry
      description: An object describing the location.
      required:
        - location
        - viewport
        - location_type
      properties:
        location:
          $ref: '#/components/schemas/LatLngLiteral'
        location_type:
          description: |
            Stores additional data about the specified location. The following values are currently supported:

            - "ROOFTOP" indicates that the returned result is a precise geocode for which we have location information accurate down to street address precision.
            - "RANGE_INTERPOLATED" indicates that the returned result reflects an approximation (usually on a road) interpolated between two precise points (such as intersections). Interpolated results are generally returned when rooftop geocodes are unavailable for a street address.
            - "GEOMETRIC_CENTER" indicates that the returned result is the geometric center of a result such as a polyline (for example, a street) or polygon (region).
            - "APPROXIMATE" indicates that the returned result is approximate.
          type: string
          enum:
            - ROOFTOP
            - RANGE_INTERPOLATED
            - GEOMETRIC_CENTER
            - APPROXIMATE
        bounds:
          $ref: '#/components/schemas/Bounds'
        viewport:
          $ref: '#/components/schemas/Bounds'
    GeolocationRequest:
      type: object
      title: GeolocationRequest
      description: 'The request body must be formatted as JSON. The following fields are supported, and all fields are optional.'
