tags:
  - name: Directions
    description: 'The Directions API is a web service that uses an HTTP request to return JSON or XML-formatted directions between locations. You can receive directions for several modes of transportation, such as transit, driving, walking, or cycling.'
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/directions/overview'
  - name: Distance Matrix
    description: The Distance Matrix API is a service that provides travel distance and time for a matrix of origins and destinations.
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/distance-matrix/overview'
  - name: Elevation
    description: 'The Elevation API provides a simple interface to query locations on the earth for elevation data. Additionally, you may request sampled elevation data along paths, allowing you to calculate elevation changes along routes.'
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/elevation/overview'
  - name: Geocoding
    description: The Geocoding API is a service that provides geocoding and reverse geocoding of addresses.
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/geocoding/overview'
  - name: Geolocation
    description: The Geolocation API returns a location and accuracy radius based on information about cell towers and WiFi nodes that the mobile client can detect.
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/geolocation/overview'
  - name: Roads
    description: 'The Roads API identifies the roads a vehicle was traveling along and provides additional metadata about those roads, such as speed limits.'
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/roads/overview'
  - name: Time Zone
    description: 'The Time Zone API provides a simple interface to request the time zone for locations on the surface of the earth, as well as the time offset from UTC for each of those locations.'
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/timezone/overview'
  - name: Street View
    description: The Street View API provides a simple interface to retrieve Street View images.
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/streetview/overview'
  - name: Places
    description: 'The Places API is a service that returns information about places using HTTP requests. Places are defined within this API as establishments, geographic locations, or prominent points of interest.'
    externalDocs:
      url: 'https://developers.google.com/maps/documentation/places/web-service/overview'
